import logo from './logo.svg';
import './App.css';
import NavTabs from './navTab';
import Container from '@mui/material/Container';
//import customLineChart from './d3Sample';
import { LineChart } from "@d3/line-chart"
import { aapl } from "@d3/line-chart"



const App = () => {
  const tabMap = [
    { 'name': 'a' ,'href': '/a'},
    { 'name': 'b' ,'href': '/b'},
    { 'name': 'c' ,'href': '/c'},
  ];

  const customLineChart=() => {
    LineChart(aapl, {
      x: d => d.date,
      y: d => d.close,
      yLabel: "↑ Daily close ($)",
      height: 500,
      color: "steelblue"
    })
  }


  return (
    <div className="App">
      <NavTabs tabMap={tabMap} />
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <Container maxWidth='sm'>
          <customLineChart />
        </Container>
      </header>
    </div>
  );
}

export default App;
